import React from 'react';
import { Card, CardTitle, Row, Col } from 'reactstrap';

const Navbar = () => {
    return (
        <Card className='navbar'>
            <Row>
                <Col xs="6">
                    <CardTitle className="navbar-brand"></CardTitle>
                </Col>
                <Col xs="6">
                    <CardTitle className=""></CardTitle>
                </Col>
            </Row>

        </Card >
    );
}

export default Navbar;
